INSERT INTO `data_artikel` (`id_artikel`, `id_kategori`, `judul`, `isi`, `pengirim`, `tanggal`, `date`, `foto`) VALUES
(5, 1, '1.809 Wisudawan Universitas Negeri Makassar Resmi Dikukuhkan', '<b></b><b></b><b></b><i></i><b></b><b></b><b></b><b></b><b></b><b></b><u></u>\r\n\r\n<p>\r\n\r\nPROFESI-UNM.COM -&nbsp;Sebanyak 1.809 mahasiswa Universitas Negeri Makassar (UNM) secara resmi dikukuhkan sebagai alumni UNM. Prosesi wisdua periode kedua tahun ajaran 2017/2018 berlangsung pelataran Menara pinisi Rabu, (11/4).</p><p>Rektor UNM, Husain Syam dalam pidatonya mengucapkan syukur atas tercetaknya alumni baru pada wisuda periode kedua tersebut.</p><div></div><p>â€œAlhamdulillah, UNM berhasil mewisuda 1.809 orang hari iniâ€ katanya.</p><p>Guru besar Teknologi Pertanian ini pun berharap agar wisudawan mempersiapkan diri dengan baik untuk mengabdikan diri di masyarakat sehingga dapat menjadi alumni UNM yang berkualitas dan mampu bersaing.</p><p>â€œSiapkan diri dengan baik untuk mengabdikan diri di masyarakat dan tunjukkan diri menjadi alumni yang berkualitasâ€ harapnya.</p><p>Adapun lulusan yang diwisuda pada hari ini diikuti oleh berbagai program dan jenjang studi, mading masing Program Doktor 47 orang, Program Magister 128 orang, Program Sarjana 1.556 orang dan Program Diploma 78 orang. (*)</p><p><strong>*Reporter: Rara Astuti</strong></p>\r\n\r\n<p></p>', 'Administrator', '2018-09-23 11:46:31', '2018-09-23', '2807201811311419042018160827IMG-20180411-WA0007.jpg'),
(7, 1, 'Ini Dia Daftar Wisudawan Terbaik Tiap Fakultas se-UNM', '<p>\r\n\r\nPROFESI-UNM.COM \r\n\r\nâ€“ Prosesi pengukuhan 1.809 mahasiswa Universitas Negeri Makassar (UNM) menjadi alumni UNM telah usai dilaksanakan. Prosesi wisuda periode kedua tahun akademik 2017/2018 tersebut berlangsung di Pelataran Menara Pinisi UNM (11/4).</p><p>Adapun nama-nama wisudawan yang memiliki Indeks Perestasi Kumulatif (IPK) tertinggi di setiap fakultas adalah sebagai berikut.</p><div></div><p>1. Arwin Wahyu Saputra dari Prodi Pendidikan Matematika FMIPA dengan IPK 3,87</p><p>2. Nur Hajar dari Prodi Administrasi Pendidikan (FIP) dengan IPK 3,86.</p><p>3. Ririn Arnita Sari dari Prodi Sastra Inggris FBS dengan IPK 3,97.</p><p>4. M. Riyo Febrian dari Prodi Pendidikan Teknologi Pertanian FT dengan IPK 3,90</p><p>5. Muhammad Azwar dari Prodi Pendidikan Jasmani dan Rekreasi FIK dengan IPK 3,96</p><p>6. Ferdiyatun Muntazarah dari Prodi Pendidikan Pancasila dan Kewarganegaraan FIS dengan IPK 3,91.</p><p>7. Nur Jumriani dari Prodi Psikologi FPsi dengan IPK 3,47.</p><div></div><p>8. Fawziah Magfirah dari Prodi Pendidikan Sendratasik FSD dengan IPK 3,83.</p><p>9. Madaniyah Yusuf dari Prodi Pendidikan Akuntansi FE dengan IPK 3,87</p><p>10. Nurhaya Ramdana dari Prodi Bahasa Inggris (Diploma tiga FBS) dengan IPK 3,94.</p><p>11. Resky Anastasia Mulya Ningrum dari Prodi Akuntansi (Diploma tiga FE) dengan IPK 3,75. (*)</p><p><strong>*St. Reski Amaliah</strong></p>', 'Administrator', '2018-09-23 11:45:32', '2018-09-23', '190420181620092018-04-11-10.03.32-1.jpg'),
(20, 1, 'Lulus di Usia 21 Tahun, Emasuhrah Jadi Wisudawan Termuda UNM', '<p>\r\n\r\n</p><p><b></b></p>\r\n\r\n<p><b>PROFESI-UNM </b>â€“ Emasuhrah menjadi wisudawan termuda dalam wisuda periode kedua tingkat Universitas Negeri Makassar (UNM) dengan usia 21 tahun 1 bulan. Predikat <em>cumlaude</em>&nbsp;berdasarkan usianya tersebut diumumkan dalam prosesi Wisuda yang dihelat di Pelataran Menara Pinisi UNM, Rabu (11/4).</p><p>Mahasiswa Fakultas Ilmu Pengetahuan Alam ( FMIPA) ini berhasil menyelesaikan studinya selama 3 tahun 6 bulan dengan Indeks Prestasi Kumulatif (IPK) 3,78.</p><p>Ia pun bercerita, rencananya ia akan melanjutkan pendidikannya pada jenjang Magister dan menargetkan kembali lulus di usia 23 tahun. â€œRencana lanjut studi di Sulawesi saja supaya dekat dengan orang tua,â€ katanya.</p><div></div><p>Mahasiswa program studi Pendidikan Matematika ICP ini pun berharap agar dirinya cepat mendapatkan pekerjaan. Ia membeberkan, dirinya sudah tidak sabar memberikan gaji pertamanya untuk kedua orang tua tercinta.</p><p>â€œYah, semoga cepat dapat kerja, supaya gaji pertamanya bisa dikasih orang tua,â€ harapnya.</p><p>Lanjut, ia berpesan kepada mahasiswa, harus aktif di perkuliahan dan tidak lupa minta restu dari orang tua agar segala urusan dilancarkan dan mendapat berkah Allah Swt.</p><p>â€œYang ingin saya sampaikan juga yaitu harus rajin kuliah dan minta restu orang tua agar diberi kemudahan dalam segala urusan,â€ katanya (*)</p>\r\n\r\n<p></p>', 'Administrator', '2018-09-23 11:31:28', '2018-09-23', '19042018170015DSC_0665.jpg'),
(21, 1, 'Begini Tips Rio Febrian Jadi Wisudawan Terbaik Fakultas Teknik UNM', '<p>\r\n\r\n</p><p><b><i><u></u></i><u></u>PROFES-UNM.COM<i></i></b> â€“ Wisuda periode kedua tahun akademik 2017/2018 telah usai dilaksanakan. Sebanyak 1.809 wisudawan secara resmi dikukuhkan sebagai alumni UNM (12/4).</p><p>Menjadi wisudawan terbaik bukanlah hal yang mudah. Namun, diakui Rio Febrian, wisudawan terbaik I Fakultas Teknik UNM, capaiannya tersebut merupakan sebuah kesyukuran baginya maupun teman-teman se-jurusannya.</p><div></div><p>â€œAlhamdulillah sebuah kesyukuran dan kesenangan sekaligus haru. Senang karena bisa mewakili teman-teman dari Prodi Pendidikan Teknologi Pertanian (PTP) sebagai wisudwan terbaik FT juga haru karena akan melepas status sebagai mahasiswa,â€ akunya.</p><p>Proses memang tak mengkhianati hasil, Rio bercerita, selama kuliah dirinya telah mencoba mengasah empat bidang kemampuan yang harus dimiliki semua orang untuk mengasah kompetensinya.</p><p>Mahasiswa angkatan 2013 ini mengatakan, kemampuan pengembangan otak maupun emosional pun harus di asah selama masa perkuliahan.</p><p>â€œAda kemampuan <em>Intelligence Quotient</em>&nbsp;(IQ) yakni dengan banyak baca, diskusi dan manajemen waktu yang baik. Juga <em>Emotional Quotient</em>&nbsp;(EQ) mengasah melalui organisasi, kegiatan luar kampus, pelatihan, seminar, wirausaha dan lainnya,â€ katanya.</p><p>Eks Ketua HMPS PTP FT UNM ini menambahkan, persoalan agama dan pengembangan keagamaan pun perlu dilakukan untuk menunjang perkuliahan.</p><div></div><p>â€œ<em>Spiritual Quotient</em>&nbsp;(SQ) juga diasah melalui pendekatan agama, kajian dan diskusi kegamaan. Dan terakhir <em>Emotional Spiritual Question</em>(ESQ) berupa manajemen bidang rohani dan pengembangan keagamaan pun perlu diterapkan,â€ bebernya. (*)</p><p><strong>*Reporter: Nurul Charismawaty</strong></p>\r\n\r\n<p></p>', 'Administrator', '2018-09-23 11:33:05', '2018-09-23', '19042018170323IMG-20180412-WA0021-1.jpg'),
(23, 1, 'Husain Syam: Wisuda Periode Ini 31% Lulus Cumlaude.', '<p></p>\r\n\r\n<p>\r\n\r\nPROFESI-UNM.COM \r\n\r\nâ€“ Prosesi Wisuda Periode Kedua Tahun Akademik 2017/2018 Universitas Negeri Makassar (UNM), mencatatkan sebanyak 31% atau sejumlah 560 orang dari 1.809 lulusan baru meraih predikat cumlaude.</p><p>Hal tersebut dilontarkan Rektor UNM, Husain Syam dalam pidatonya. Ia mengatakan indeks prestasi rata-rata setiap jenjang studi yakni untuk program doktor 3,73, sedangkan untuk program magister 3,72, sementara program sarjana reguler 3,44 program sarjana penyetaraan 3,38 dan nilai 3,52 untuk program diploma tiga.</p><div></div><p>â€œDari 1.809 orang lulusan yang diwisuda, terdapat 560 orang atau 31% yang lulus dengan predikat Pujian atau Cum Laude,â€ katanya.</p><p>Ia pun berharap, para wisudawan dan wisudawati dapat mempersiapkan dirinya untuk mengabdi di lingkungan masyarakat dan membawa nama baik UNM.</p><p>â€œâ€œSiapkan diri dengan baik untuk mengabdikan diri di masyarakat dan tunjukkan diri menjadi alumni yang berkualitasâ€ harapnya. (*)</p><p><strong>*Reporter: St. Reski Amalia</strong></p>\r\n\r\n<div></div><div><br></div>', 'Administrator', '2018-09-23 11:46:12', '2018-09-23', '2807201811342719042018161032DSC_0467.jpg'),
(25, 1, 'UNM Terapkan Sistem 1000 Pendaftar Wisuda', '<p>\r\n\r\n</p><p></p>\r\n\r\n<p>\r\n\r\nPROFESI-UNM.COM&nbsp; â€“ Tahun akademik 2018/2019, Universitas Negeri Makassar (UNM) akan gelar wisuda setiap seribu pendaftar. Hal tersebut diungkapkan Wakil Rektor Bidang Akademik, Muharram saat ditemui di acara Narasi Roadshow Makassar, Sabtu (25/8).</p><p>Dirinya mengungkapkan bahwa mulai saat ini, pendaftaran wisuda akan dibuka terus menerus tanpa sistem periodisasi seperti yang diberlakukan sebelumnya. Apabila kuota pendaftar wisuda telah mencapai seribu orang maka prosesi wisuda akan segera dilaksanakan dua minggu setelahnya.</p><p>â€œIni kebijakan baru. Biar dalam sebulan sudah cukup seribu pendaftar, dua minggu setelahnya langsung wisuda,â€ ungkapnya.</p><div></div><p>Muharram menambahkan bahwa diberlakukannya kebijakan ini, mampu memberikan kesempatan untuk para calon alumni dapat fokus dalam menyelesaikan studi tanpa harus dikejar oleh waktu pendaftaran wisuda. Hal tersebut diharapkannya dapat memberikan dampak bagi keluaran UNM yang berkualitas.</p><p>â€œSupaya alumni berkualitas. Jangan memburu waktu pendaftaran wisuda biar cepat selesai dan biar tidak bayar UKT.â€</p><p><strong>*Reporter : St. Reski Amalia</strong></p>\r\n\r\n<p></p>\r\n\r\n<p></p>', 'Administrator', '2018-09-23 11:45:00', '2018-09-23', '27082018050938IMG_9815.jpg'),
(26, 1, 'Rektor UNM Bebaskan Tes Masuk Pascasarjana Kepada Wisudawan Dengan IPK Diatas 3,50', '<p><a target="_blank" rel="nofollow" href="http://profesi-unm.com/"><strong></strong></a></p>\r\n\r\n<p>PROFESI-UNM.COM â€“ Rektor Universitas Negeri Makassar (UNM) Husain Syam, janji akan bebaskan tes masuk Program Pascasarjana (PPs) kepada wisudawan dengan Indeks Prestasi Kumulatif (IPK) 3,50 keatas, hal tersebut diungkapkan pada malam ramah tamah Fakultas Ilmu Pendidikan (FIP) Universitas Negeri Makassar (UNM) di Gedung Lantai II tower B Hotel Claro Makassar, Selasa (7/8).</p><p>Rektor UNM, Husain Syam mengatakan kepada wisudawan yang memiliki IPK diatas 3,50 maka bebas tes masuk Program Pascasarjana. Ia juga mengatakan, setiap keluaran UNM pasti merupakan bibit unggul.</p><div></div><p>â€œKhusus bagi wisudawan yang memiliki IPK 3,50 ke atas, saya akan bebaskan masuk Pascasarjana tanpa tes, dengan persyaratan harus memiliki IPK yang tinggi,â€ katanya.</p><p>Lanjut, Ia menghimbau kepada orang tua wisudawan yang masih memiliki putra dan putri, agar menguliahkan anak mereka di kampus beralmamater orange tersebut.</p><p>â€œSilahkan kuliahkan anak Ibu dan Bapak di UNM, sebab UNM pencetak bibit unggul, banyak keluaran UNM diluar sana yang sukses,â€ tutupnya.</p><p><strong>*Reporter: Ulil Afiah Az-zakiyah</strong><br></p>\r\n\r\n<p><strong></strong></p>', 'Administrator', '2018-09-23 11:44:19', '2018-09-23', '27082018054700DSC_0866-compressed.jpg'),
