INSERT INTO `data_loker` (`id_loker`, `judul`, `isi`, `pengirim`, `tanggal`, `tgl`) VALUES
(4, 'Lowongan Kerja Terbaru Untuk Tamatan SMA/SMK tahun 2017 dari Bank Mandiri', '<p>\r\n\r\n</p><div><b>Persyaratan Umum</b></div><div>1. Pria maupun Wanita</div><div>2. Usia Maks 24 tahun</div><div>3. Bisa Komputer (word, excel, power point, acxes)</div><div>4. Pendidikan minimal SMA/SMK</div><div>5. Dapat berbahasa Inggris secara lisan maupun tertulisa akan menjadi nilai tambah</div><div>6. Nilai rata-rata Min 6,5</div><div>7. Sehat Jasmi dan rohani </div><div>8. Tidak buta warna dan tidak pernah mengkonsumsi Narkotika</div><div>9. Tidak pernah melakukan tidak pidana kejahatan apapun</div><div><br>Cara mendaftar</div><ul><li>Dalam melakukan pendaftaran di bank Mandiri ini cukup mudah, dengan cara buka website resminya dan cari menu karirr, setelah dibuka akan ada beberapa sub bagian lowongan yang  dibutuhkan disana, anda tinggal pilih dan klik apply yang ada pada bawah halaman.</li><li>Kemudian akan terbuka informasi beberapa data yang harus dilengkapi. lengkapi data hingga selesai.</li><li>Setelah proses itu anda lakukan, silahkan tunggu beberapa waktu, jika anda beruntung</li></ul>', 'Administrator', '2018-08-28 07:55:23', '2018-08-28'),
(5, 'Supervisor Customer Service 3 Store (Makassar)', '<p>\r\n\r\n</p><div><b><i></i></b><b></b>PT Mitracomm Ekasarana - Makassar<div>Rp. 5,000,000 - Rp. 7,000,000 a month</div></div><p>SPV CUSTOMER SERVICE 3 STORE (Makassar)</p><p>Tugas &amp; Tanggung jawab :</p><ul><li>Bertanggung jawab melakukan supervisi, pengawasan dan mendukung aktivitas harian di outlet terutama dalam pelaksanaan Mekanisme dan prosedur demi mencapai kepuasan pelanggan dalam memberikan kontribusi kepada tujuan perusahaan</li></ul><p>Kualifikasi :</p><ul><li>Max 28 Thn</li><li>Pendidikan Min S1 Semua Jurusan</li><li>Memiliki penampilah rapih dan menarik</li><li>Memiliki pengalaman Min 1 tahun di bidang retail sebagai Team Leader/SPV (Lebih disukai di bidang telekomunikasi/Provider)</li><li>Memiliki komunikasi yang baik dan efektif</li><li>Berorientasi pada target</li><li>Menguasai MS. Office</li><li>Menguasai Bahasa Inggris dengan baik</li><li>Memiliki jiwa service customer dengan baik</li><li>Penempatan Makassar</li></ul><p>Jenis Pekerjaan: Penuh Waktu<i></i></p><b>\r\n\r\n</b><br><p></p>', 'Administrator', '2018-08-27 07:24:04', '2018-08-27'),
(6, 'Lowongan Kerja PT DANAREKSA Tamatan SMA/SMK Terbaru 2018/2019', '<p>\r\n\r\n</p><div>Lowongan Kerja PT DANAREKSA Tamatan SMA/SMK kembali akan melakukan rekrutmen calon karayawanbaru untuk tahun 2017 dengan kualifikasi pendidikan minimal SMA/SMK sederajat. Perushaan yang bergerak dibidang jasa Fidusia ini mencari putra dan putri Indonesia untuk bergabung bersama dengan perushaan ini sebagai jasa fidusia. Bagi anda yangmarasa memiliki kemampuan, skill dan potensi yang tinggi dalam dunia pekerjaan segera daftarkan diri anda, namun sebelum melakukan pendaftran mohon kiranya untuk menyimak ulasan mengenai informasi lowongan pekerjaan dari PT Danareksa untuk minimal pendidikan  SMA/SMK tahun 2017.\r\n\r\n<br></div><div><br></div><div>Informasi lowongan kerja SMA/SMK tahun 2017 dari perusahaan jasa fidusia milik BUMN yaitu PT Danareksa.</div><div>Persyaratan Umum</div><ol><li>Laki-laki dan wanita (warga negara Indonesia)</li><li>Sehat Jasmanai (tidak cacat fisik) dan rohani</li><li>Pendidikan minimal SMA/SMK atau yang sederajat lainnya</li><li>Nilai UN rata-rata 39</li></ol>\r\n\r\n<br><p></p>', 'Administrator', '2018-08-27 07:24:11', '2018-08-27'),
(7, 'Lowongan Kerja BINTANG', '<p>\r\n\r\n</p><p><b>Alamat : Jl. Perintis Kemerdekaan Km.12</b></p><p><b>Kualifikasi:<br></b>1. Wanita 22-28 tahun<br>2. Pendidikan minimal S1<br>3. Memiliki pengalaman min. 1 tahun sebagai HR C n B<br>4. Teliti, disiplin, tegas, dan cekatan<br>5. Mengerti proses perhitungan gaji karyawan<br>6. BPJS Kesehatan dan BPJS Ketenagakerjaan<br>7. Mampu belajar dengan cepat<br>8. Mampu bekerja dibawah tekanan<br>9. Mampu bekerja dengan tim dan individual</p><p>Syarat umum:</p><p>- Surat Lamaran Pekerjaan<br>- Daftar Riwayat Hidup<br>- Fotocopy KTP<br>- Fotocopy KK<br>- Fotocopy Ijazah terakhir<br>- Fotocopy SKCK<br>- Surat pengalaman kerja<br>- Pas Foto 3x4 (2 lembar)<br>- Surat Keterangan Berbadan Sehat</p><p>Segera kirimkan lamaran &amp; CV anda ke:<br>HR RECRUITMENT<br>PT. BINTANG INTERNASIONAL<br>(Bintang Accessories dan Spare Part Gadget)<br>Jl. Perintis Kemerdekaan Km. 12 (Belakang Toko Bintang Perintis) Makassar<br>atau kirim ke email kami di :<br>Rekrutmen.bintang@gmail.com/HRmanager.bintang@gma</p>\r\n\r\n<br><p></p>', 'Administrator', '2018-08-27 07:23:20', '2018-08-27');
